import "./products.css";
import Product from "../product/product.js";
import { trackPromise, usePromiseTracker } from "react-promise-tracker";
import { useEffect, useState } from "react";
import axios from "axios";
import get_data from "../../utils.js";
import EmptyPage from "../empty_page/empty_page.js";

const area = "products";
const apiUrl = "http://127.0.0.1:8000/products";
const token = "048f016a3a1e9c783c23cc190e0eb9d2d391e929";

function Products() {
  const { promiseInProgress } = usePromiseTracker({ area });
  const [products, setProducts] = useState([]);

  useEffect(() => {
    get_data(trackPromise, apiUrl, token, setProducts);
  }, [setProducts]);

  if (!products || products.length == 0) {
    return <EmptyPage text="No products" />;
  } else if (promiseInProgress) {
    return <div>Подождите, данные загружаются!</div>;
  } else {
    return (
      <div className="products">
        <div className="pageTitle">PRODUCTS</div>
        <div className="productsPageContainer">
          <div className="productsSortFilter">
            <div className="filter">
                <div className="filterTitle">Sort By</div>
                <div className="radioElement"><input type="radio"/>Price increase</div>
                <div className="radioElement"><input type="radio"/>Price decrease</div>
                <div className="radioElement"><input type="radio"/>From A to Z</div>
                <div className="radioElement"><input type="radio"/>From Z to A</div>
            </div>
            <div className="filter">
                <div className="filterTitle">Filter by colors</div>
                <div className="choiceElement"><input type="checkbox"/>red</div>
                <div className="choiceElement"><input type="checkbox"/>blue</div>
                <div className="choiceElement"><input type="checkbox"/>green</div>
                <div className="choiceElement"><input type="checkbox"/>black</div>
            </div>
            <div className="filter">
                <div className="filterTitle">Filter by brands</div>
                <div className="choiceElement"><input type="checkbox"/>Brand</div>
                <div className="choiceElement"><input type="checkbox"/>Brand</div>
                <div className="choiceElement"><input type="checkbox"/>Brand</div>
            </div>
            <div className="filter">
                <div className="filterTitle">Filter by size</div>
                <div className="choiceElement"><input type="checkbox"/>XL</div>
                <div className="choiceElement"><input type="checkbox"/>L</div>
                <div className="choiceElement"><input type="checkbox"/>M</div>
                <div className="choiceElement"><input type="checkbox"/>S</div>
                <div className="choiceElement"><input type="checkbox"/>XS</div>
            </div>
            <div className="filter">
                <div className="filterTitle">Price</div>
                <div>120</div><input type="range"></input><div>12 000</div><br></br><br></br><br></br><br></br><br></br><br></br>
            </div>
          </div>
          <div className="productsContainer">
            {products.map((prod) => (
              <Product
                name={prod.name}
                price={prod.price}
                key={prod.id}
              ></Product>
            ))}
          </div>
        </div>
      </div>
    );
  }
}

export default Products;
